            alt="tênis1"
          />
          <strong>Tênis muitxo doido</strong>
          <span>R$200,00</span>

          <button type="button">
            <div>
              <MdAddShoppingCart size={16} color="#FFF" /> 3
            </div>

            <span>ADICIONAR AO CARRINHO</span>
          </button>
        </li>
      </ProductList >
    );
  }
}
